import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Click the "Your Profile" link to navigate to the profile page
    await page.waitForSelector("a:has-text('Your Profile')", { timeout: 5000 });
    await page.getByRole('link', { name: 'Your Profile' }).first().click();

    // Wait for the profile page content to be rendered
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();
    const totalOrders = await page.locator("//div[contains(@class, 'stat') and .//span[text()='Orders']]//span[contains(@class, 'stat-number')]").textContent();
    const totalReviews = await page.locator("//div[contains(@class, 'stat') and .//span[text()='Reviews']]//span[contains(@class, 'stat-number')]").textContent();
    const sellerRating = await page.locator("//div[contains(@class, 'stat') and .//span[text()='Seller Rating']]//span[contains(@class, 'stat-number')]").textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      totalOrders: parseInt(totalOrders.trim(), 10),
      totalReviews: parseInt(totalReviews.trim(), 10),
      sellerRating: parseFloat(sellerRating.trim())
    };

    return {
      success: true,
      action: "Clicked 'Your Profile' link and extracted user information from the profile page.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
